import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router,  Route,  Switch ,Link} from 'react-router-dom';
import Routes from './routes';
function App() {
  return (

    <div className="App">
      
     <Router>
      <ul>
                    <li><Link to="/welcome">React</Link></li>
                     <li><Link to="/gallery">React</Link></li>
               </ul>
      </Router>  
    </div>
  );
}

export default App;
